// Esta pagina sirve para definir las rutas
// Las rutas es la forma en la que express maneja las peticiones que se hacen al servidor.

import { Router } from "express"; //Permite definir varias rutas y agruparlas
import * as employeeCtrl from '../controllers/employees.controller';
const router = Router(); //Ejecutando y almacenando el objeto en constante router


// Peticion get, se usa la palabra reservada async puesto que debe esperar la respuesta de await.
router.get('/getEmployees', employeeCtrl.findAllEmployees);

// Peticion post, se usa la palabra reservada async puesto que debe esperar la respuesta de await.
router.post('/createEmployee', employeeCtrl.saveEmployee);

router.get('/:id', employeeCtrl.findById);

router.delete('/:id', employeeCtrl.deleteById);

router.post('/employeeCheckIn', employeeCtrl.employeeCheckIn);

export default router;

