import Schedule from '../models/Schedule';

export const getFullSchedule = async (req, res) => {
    const query = await Schedule.find();
    res.json(query);
};

export const employeeCheckIn = async (req, res) => {
    const currentDate = new Date();
    const currentDay = currentDate.getDate();
    const currentDayWeek = currentDate.getDay();
    const currentMonth = currentDate.getMonth();
    const currentYear = currentDate.getFullYear();
    const currentHour = currentDate.getHours() + ':' + currentDate.getMinutes();

    const checkIn = new Schedule({
        createdDay: currentDay,
        createdDayWeek: currentDayWeek,
        createdMonth: currentMonth,
        createdYear: currentYear,
        createdHour: currentHour,
        checkedIn: true 
    });
    await checkIn.save();
    res.send('Check in succesfully');
};

export const getScheduleByMonth = async (req, res) => {
    const query = await Schedule.find(req.params);
    res.json(query);
};

export const getScheduleByDay = async (req, res) => {
    const query = await Schedule.find(req.params);
    if(!query){
        res.send('Not found');
    }
    res.json(query);
};

