import Employees from '../models/Employees' //Importando modelo Employee para trabajar con el

export const findAllEmployees = async (req, res) => {
    //Almacena la informacion obtenida de la funcion find().
    const query = await Employees.find(); // Palabra reservada await para esperar la respuesta
    res.json(query); //wordDevuelve le resultado en forma de json
};

export const saveEmployee = async (req, res) => {
    // Creacion de objeto newEmployee que crea a su vez un modelo con los datos recibidos
    const newEmployee = new Employees({ 
        name: req.body.name,            //Obteniendo del objeto req la propiedad name
        lastName: req.body.lastName,    //Obteniendo del objeto req la propiedad lastName
        age: req.body.age,              //Obteniendo del objeto req la propiedad age
        jobTitle: req.body.jobTitle     //Obteniendo del objeto req la propiedad jobTitle
    });
    await newEmployee.save(); //Haciendo uso de la propiedad save() de express para almacenar 
    res.json('New employee created'); // Devuelve un mensaje de exito
};
 
export const findById = async (req, res) => { //Declaraci[on de funcion asincrona
    //Uso de la funcion findById()
    const employeeById = await Employees.findById(req.params.id) //Enviando el id recibido de la peticion
    res.json(employeeById) //Devolviendo respuesta en formato .json
}

export const deleteById = async (req, res) => { //Declaracion de funcion asincrona
    //Obteniendo el documento a eliminar
    const employeeDeleted = await Employees.findByIdAndDelete(req.params.id) //Enviando el id recibido de la peticion
    if (!employeeDeleted){ //Condicional que permite verificar si el usuario solicitado existe.
        res.send('Employee not found')}
    res.send('Employee ' + employeeDeleted.name + ' deleted succesfully') //Devolviendo respuesta a cliente
}

